import React from "react";
import { AboutContainer, AboutDesc, AboutImg } from "./AboutElements";
import aboutPokeball from "../../assets/images/aboutPokeball.png";
const About = () => {
  <AboutContainer>
    <AboutDesc>
      Lorem ipsum dolor sit amet, consectetur adipiscing elit. Risus amet
      pharetra faucibus dui in vulputate nisl. Accumsan id ut vel nisl mollis
      volutpat auctor enim suspendisse. Faucibus.
    </AboutDesc>
    <AboutImg src={aboutPokeball} />
  </AboutContainer>;
};
export default About;
